import { Col, Row, Button } from "react-bootstrap";
function Writelist() {
  <>
    <Row className="mb-3 justify-content-end">
      <Col xs="auto">
        <Button variant="primary">등 록</Button>
      </Col>
    </Row>
    {
      <Row>
        <Col xs={8}>dd</Col>
        <Col xs={2}>ddd</Col>
        <Col xs={2} className="text-right"></Col>
      </Row>
    }
  </>;
}
export default Writelist;
